mapper.select:
select 

from TF_B_TRADE_GROUP
where TRADE_ID = #{tradeId,jdbcType=DECIMAL}
  and ACCEPT_MONTH = #{acceptMonth,jdbcType=DECIMAL}
  and CUST_ID = #{custId,jdbcType=DECIMAL}

mapper.delete:
delete from TF_B_TRADE_GROUP
where TRADE_ID = #{tradeId,jdbcType=DECIMAL}
  and ACCEPT_MONTH = #{acceptMonth,jdbcType=DECIMAL}
  and CUST_ID = #{custId,jdbcType=DECIMAL}
